  border-radius: 5px 0px 0px 0px;
  width:50%;
  height:40px;
  padding:7px;
  text-align: center;
}
div.titlePublicDocs{
  background-color: var(--senary);
  border-radius: 0px 5px 0px 0px;
  width:50%;
  height:40px;
  padding:7px;
  text-align: center;
}
div.privates{
  background-color: var(--senary);
  border-radius: 5px 0px 0px 0px;
  width:50%;
  height:40px;
  padding:7px;
}



`
